import React from 'react'
import './NavbarComp.css'
import { NavLink } from 'react-router-dom'
const NavbarComp = () => {
  return (
    <div className="nav">
    <NavLink to="/"></NavLink>
    
    <NavLink to="/cart"><i class="fa fa-cart-plus"></i></NavLink>
  </div>
  )
}

export default NavbarComp
